The mobile application «VW parts and diagrams" contains full information on spare parts and accessories for cars of concern VW. With this application you can see the structure of your car and to find any spare part. All the parts are shown in the diagrams (schemes).
Information is divided into blocks: gearbox, bodywork, braking system, electrical system, engine, chassis, etc.;
The program is constantly updated with new models and parts.
